import React from 'react';
import {Route, Routes} from 'react-router-dom';

import MainPage from "./MainPage";
import Navbar from "./Navbar/Navbar";
import Footer from "./Footer/Footer";

import Immovables from "./Categories/Immovables/Immovables";
import Transport from "./Categories/Transport/Transport";
import Household from "./Categories/Household/Household";

import CreateAdContainer from "./CreateAd/CreateAdContainer";
import Adverts from "./Adverts/Adverts";
import NavBarContainer from "./Navbar/NavBarContainer";
import ViewAdContainer from "./ViewAd/ViewAdContainer";
import MyAdvertsContainer from "./Profile/MyAdverts/MyAdvertsContainer";
import ProfileSettingsContainer from "./Profile/Settings/ProfileSettingsContainer";

const Router = (props) => {

  return (
      <div>
        <NavBarContainer/>
        <Routes>
          <Route path={"/alallalalal" || "/"} element={
            <div>
              <MainPage/>
              <Adverts categoryName={'Новые объявления'} listAd={props.state.listAd}/>
            </div>
          }/>

          <Route path={"nedvijimost"} element={
            <div>
              <Immovables/>
              <Adverts categoryName={'Недвижимость'} listAd={props.state.immovables.listAd}/>
            </div>
          }/>

          <Route path={"transport"} element={
            <div>
              <Transport/>
              <Adverts categoryName={'Транспорт'} listAd={props.state.transport.listAd}/>
            </div>
          }/>

          <Route path={"all_for_home"} element={
            <div>
              <Household/>
              <Adverts categoryName={'Всё для дома'} listAd={props.state.household.listAd}/>
            </div>
          }/>

          <Route exact path={"nedvijimost/kvartiri"} element={
            <div>
              <Immovables/>
              <Adverts categoryName={'Квартиры'} listAd={props.state.immovables.apartaments.listAd}/>
            </div>
          }/>

          <Route exact path={"nedvijimost/doma"} element={
            <div>
              <Immovables/>
              <Adverts categoryName={'Дома'} listAd={props.state.immovables.houses.listAd}/>
            </div>
          }/>

          <Route exact path={"transport/mashini"} element={
            <div>
              <Transport/>
              <Adverts categoryName={'Машины'} listAd={props.state.transport.cars.listAd}/>
            </div>
          }/>

          <Route exact path={"transport/motocicly"} element={
            <div>
              <Transport/>
              <Adverts categoryName={'Мотоциклы'} listAd={props.state.transport.motocycles.listAd}/>
            </div>
          }/>

          <Route exact path={"all_for_home/bitovaya_technika"} element={
            <div>
              <Household/>
              <Adverts categoryName={'Бытовая техника'} listAd={props.state.household.appliances.listAd}/>
            </div>
          }/>

          <Route exact path={"all_for_home/mebel"} element={
            <div>
              <Household/>
              <Adverts categoryName={'Мебель'} listAd={props.state.household.furniture.listAd}/>
            </div>
          }/>

          <Route exact path={"/ad/create"} element={<CreateAdContainer/>}/>

          <Route exact path={"/ad/id:id"} element={<ViewAdContainer/>}/>

          <Route exact path={"/profile/advert"} element={<MyAdvertsContainer/>}/>
          <Route exact path={"/profile/settings"} element={<ProfileSettingsContainer/>}/>

        </Routes>
        <Footer/>
      </div>
  );
};

export default Router;
